import "./Dashbord.css";
import download from "../images/download.png";
import slogo from "../images/shlogo.jpg";
import user from "../images/user.png";
// import axios from "axios";
// import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Dashbord() {
  return (
    <div>
      <div className="flex p-9  bg-gray-600 ">
        <img src={slogo} alt="img" className="h-20  w-20  rounded-3xl" />
        <div className="px-5 py-5  text-5xl ">
          <h1>
            Society<span>HUB</span>
          </h1>
        </div>
      </div>
      <div className="main  flex">
        <div className="flex flex-col bg-gray-800  w-80 h-dvh">
          <div id="img_nav">
            <center><img src={user} className="h-40 mt-10"  alt=""/><h2 className="text-2xl  text-gray-400">Ketan</h2></center>
          </div>
          <div className="text-2xl p-10  ">
            <div className="navi flex flex-col gap-8 text-white">
             <section className=" bg-red-900"><Link to="/Dashbord">Dashbord</Link></section>
             <section><Link to="/Notic">Notic Board</Link></section>
             <section><Link to="/Complaint">Register Complaint</Link></section>
             <section><Link to="/Photos">Photo Gallery</Link></section>
            </div>
          </div>
        </div>
        <div className="main_dash">
          Dash Board
          <div>
            <div>
              <section>
                <img src={download} alt="" />
              </section>
              <section>User Name</section>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashbord;
